{
  "translationLines": [
    {
      "lineNumber": 35371,
      "originalJapaneseLine": "　そしてこの魔王城……",
      "translatedEnglishLine": "And this Demon King's Castle..."
    },
    {
      "lineNumber": 35372,
      "originalJapaneseLine": "　これで、全て陥落させたわけだけど……」",
      "translatedEnglishLine": "With this, we've brought them all down..."
    },
    {
      "lineNumber": 35373,
      "originalJapaneseLine": "「やはり、城内に魔人ケイブリスはおらぬ様ですな」",
      "translatedEnglishLine": "\"As expected, it seems the demon Kaibriss is not inside the castle.\""
    },
    {
      "lineNumber": 35374,
      "originalJapaneseLine": "「となると、手がかりは……",
      "translatedEnglishLine": "\"Then, the clue is...\""
    },
    {
      "lineNumber": 35375,
      "originalJapaneseLine": "　魔物隊長から聞いたという、ルッコンフードか」",
      "translatedEnglishLine": "The Rukon Food that we heard about from the monster captain, huh?"
    },
    {
      "lineNumber": 35376,
      "originalJapaneseLine": "「俺は信じられる……と思う。",
      "translatedEnglishLine": "\"I think I can believe it...\""
    },
    {
      "lineNumber": 35377,
      "originalJapaneseLine": "　嘘を挟んだ風には見えなかった」",
      "translatedEnglishLine": "It didn’t appear to contain any lies."
    },
    {
      "lineNumber": 35378,
      "originalJapaneseLine": "「……ま、わからんでも無いが……どうだ？」",
      "translatedEnglishLine": "\"...Well, I don’t completely disagree... What do you think?\""
    },
    {
      "lineNumber": 35379,
      "originalJapaneseLine": "「さてさて。",
      "translatedEnglishLine": "\"Now then."
    },
    {
      "lineNumber": 35380,
      "originalJapaneseLine": "　この際、他に当たれる候補がないなら、",
      "translatedEnglishLine": "If there are no other candidates to investigate at this point,"
    },
    {
      "lineNumber": 35381,
      "originalJapaneseLine": "　飛びつくしかないんでやすが……」",
      "translatedEnglishLine": "we have no choice but to jump on it..."
    },
    {
      "lineNumber": 35382,
      "originalJapaneseLine": "「元の根拠地……ベズドグ山というらしいですが、",
      "translatedEnglishLine": "\"The original base... seems to be called Mount Bezudogu,"
    },
    {
      "lineNumber": 35383,
      "originalJapaneseLine": "　そこを調べる選択肢も、ありはしますが……」",
      "translatedEnglishLine": "Investigating that place is also an option..."
    },
    {
      "lineNumber": 35384,
      "originalJapaneseLine": "「魔人ケイブリスが逃げているのは、",
      "translatedEnglishLine": "\"It is certain that demon Kaibriss is on the run."
    },
    {
      "lineNumber": 35385,
      "originalJapaneseLine": "　間違いないです。そこにはいないと思います」",
      "translatedEnglishLine": "I'm sure he’s not there."
    },
    {
      "lineNumber": 35386,
      "originalJapaneseLine": "「……本当か？」",
      "translatedEnglishLine": "\"...Is that true?\""
    },
    {
      "lineNumber": 35387,
      "originalJapaneseLine": "「まず、伝え聞く性格。猜疑心と保身の塊。",
      "translatedEnglishLine": "\"First, based on what is heard of his personality — a ball of suspicion and self-preservation."
    },
    {
      "lineNumber": 35388,
      "originalJapaneseLine": "　魔軍の指揮も執っていない。",
      "translatedEnglishLine": "He’s not commanding the demon army."
    },
    {
      "lineNumber": 35389,
      "originalJapaneseLine": "　……他に任せられる魔人はもういないのに」",
      "translatedEnglishLine": "...Even though there are no other demons who can be entrusted with it."
    },
    {
      "lineNumber": 35390,
      "originalJapaneseLine": "「この時点で、魔軍にはもう目を向けていない。",
      "translatedEnglishLine": "\"At this point, he’s no longer focused on the demon army."
    },
    {
      "lineNumber": 35391,
      "originalJapaneseLine": "　戦意喪失した可能性も無くはないですが……",
      "translatedEnglishLine": "There’s a possibility he lost the will to fight, but..."
    },
    {
      "lineNumber": 35392,
      "originalJapaneseLine": "　彼には、まだ希望がある」",
      "translatedEnglishLine": "He still has hope."
    },
    {
      "lineNumber": 35393,
      "originalJapaneseLine": "「……リトルプリンセスか。",
      "translatedEnglishLine": "\"...The Little Princess, huh."
    },
    {
      "lineNumber": 35394,
      "originalJapaneseLine": "　魔王になれば勝てる……と」",
      "translatedEnglishLine": "He believes that if he becomes the Demon King, he can win..."
    },
    {
      "lineNumber": 35395,
      "originalJapaneseLine": "「野心の塊でもあるようですからな。",
      "translatedEnglishLine": "\"He seems to be a bundle of ambition as well."
    },
    {
      "lineNumber": 35396,
      "originalJapaneseLine": "　諦めは悪いでしょう」",
      "translatedEnglishLine": "He won’t give up easily."
    },
    {
      "lineNumber": 35397,
      "originalJapaneseLine": "「待ち構えるつもりなら、軍を掌握しない筈はない。",
      "translatedEnglishLine": "\"If he intended to lie in wait, he would have control of the army."
    },
    {
      "lineNumber": 35398,
      "originalJapaneseLine": "　つまり……どこかに隠れて、時間を稼ぐ算段です」",
      "translatedEnglishLine": "In other words... he’s hiding somewhere, buying time."
    },
    {
      "lineNumber": 35399,
      "originalJapaneseLine": "「なら、もう本拠地に残る選択肢はないわね。",
      "translatedEnglishLine": "\"Then, there is no choice but that he’s no longer at the main base."
    },
    {
      "lineNumber": 35400,
      "originalJapaneseLine": "　そこは、調べれば分かる場所だもの。",
      "translatedEnglishLine": "That place would be known if investigated."
    },
    {
      "lineNumber": 35401,
      "originalJapaneseLine": "　普通に考えて、隠れきれる保証なんて無い」",
      "translatedEnglishLine": "Normally, it’s unlikely he could hide completely."
    },
    {
      "lineNumber": 35402,
      "originalJapaneseLine": "「そう。その裏を掻く事もあり得なくはないですが、",
      "translatedEnglishLine": "\"Yes. While there’s a possibility he might try to deceive us,"
    },
    {
      "lineNumber": 35403,
      "originalJapaneseLine": "　自分の身を賭けて博打する性格でもない」",
      "translatedEnglishLine": "he’s not the type to gamble his own life."
    },
    {
      "lineNumber": 35404,
      "originalJapaneseLine": "「その、ルッコンフード。",
      "translatedEnglishLine": "\"That 'Rukon Food.'"
    },
    {
      "lineNumber": 35405,
      "originalJapaneseLine": "　その単語を聞いたという話が、偽装の可能性は？」",
      "translatedEnglishLine": "Is there a possibility that the story about hearing that word is a ruse?"
    },
    {
      "lineNumber": 35406,
      "originalJapaneseLine": "「そこまではなんとも。又聞きさえしてませんし……",
      "translatedEnglishLine": "\"I can't say for sure. I haven’t even heard it secondhand..."
    },
    {
      "lineNumber": 35407,
      "originalJapaneseLine": "　そこまで小細工する性格でもないとは思いますが」",
      "translatedEnglishLine": "Though I don't think he’s that cunning."
    },
    {
      "lineNumber": 35408,
      "originalJapaneseLine": "「……情報と意見をまとめて、送ってみるか。",
      "translatedEnglishLine": "\"...Let’s gather the information and opinions, and send them."
    },
    {
      "lineNumber": 35409,
      "originalJapaneseLine": "　その上で、あいつがどうするか、だが……」",
      "translatedEnglishLine": "Then, let’s see what he does after that..."
    },
    {
      "lineNumber": 35410,
      "originalJapaneseLine": "「……ルッコンフード？」",
      "translatedEnglishLine": "\"...Rukon Food?\""
    },
    {
      "lineNumber": 35411,
      "originalJapaneseLine": "「は、はい！　そこに向かったという可能性が、",
      "translatedEnglishLine": "\"Y-yes! The possibility that he headed there seems high..."
    },
    {
      "lineNumber": 35412,
      "originalJapaneseLine": "　どうやら高いのでは、と……」",
      "translatedEnglishLine": "\"Apparently it is."
    },
    {
      "lineNumber": 35413,
      "originalJapaneseLine": "「確かなんだろうな？」",
      "translatedEnglishLine": "\"It's certain, isn't it?\""
    },
    {
      "lineNumber": 35414,
      "originalJapaneseLine": "「報告を聞いて、私たちも考えましたが……",
      "translatedEnglishLine": "\"After hearing the report, we also thought about it..."
    },
    {
      "lineNumber": 35415,
      "originalJapaneseLine": "　ウルザさん、クリームさんとも、同じ意見でした」",
      "translatedEnglishLine": "Urza and Cream shared the same opinion."
    },
    {
      "lineNumber": 35416,
      "originalJapaneseLine": "「よし、なら信じる。",
      "translatedEnglishLine": "\"Alright, then I believe it."
    },
    {
      "lineNumber": 35417,
      "originalJapaneseLine": "　で……どこだそれは。サテラ？」",
      "translatedEnglishLine": "So... where is that? Satera?"
    },
    {
      "lineNumber": 35418,
      "originalJapaneseLine": "「ルッコンフード……るっこんふーど……？",
      "translatedEnglishLine": "\"Rukon Food... Rukon Food...?\""
    },
    {
      "lineNumber": 35419,
      "originalJapaneseLine": "　聞いた事ないぞ……？」",
      "translatedEnglishLine": "\"I've never heard of it before...\""
    },
    {
      "lineNumber": 35420,
      "originalJapaneseLine": "「…………あります。心当たりが……」",
      "translatedEnglishLine": "\"...I have heard of it. I have an idea..."
    }
  ]
}

